パックスナチュロン お風呂洗いせっけん(泡スプレー) 詰め替え用 450ml<br>ブランド：パックスナチュロン<br>販売・製造元：太陽油脂<br><br>植物油(パーム、パーム核)を主原料とした液状石鹸を使用した、使いやすいお風呂洗い用洗剤です。オレンジの皮から搾ったオレンジオイルを使用しているので、この一本で幅広くお使いいただけます。お風呂洗い用や住居用にお使いください。詰替用。 <br>使用上の注意●白木、桐など吸収しやすい素材には使用しないで下さい。●塗装した面は、はげることがありますので目立たない部分で試してからお使い下さい。●幼児の手の届くところに置かないで下さい。●万一飲み込んだ場合は水を飲ませるなどの処置をして下さい。●目に入ったときはこすらずに、流水で十分洗って下さい。 製品仕様用途：浴槽・住宅用液性：弱アルカリ性成分：純石けん分(10%脂肪酸カリウム) <br>日用品／掃除用品／お風呂用 掃除用品／洗剤 おふろ用<br>JANコード： 4904735053293<br><br>CS：12<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
